import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const ListTotal = () => {
  const [lists, setLists] = useState([]);
  useEffect(() => {
    fetch('https://jsonplaceholder.typicode.com/posts')
      .then((res) => res.json())
      .then((res) => setLists(res));
  }, []);
  return (
    <div>
      <li></li>
    </div>
  );
};

export default ListTotal;
